%[text] This script illustrates how basal gaps are invalidated between data gaps in the raw data.
%   Author: Jan Wrede
%   Date: 2025-10-22
%   
%   This file is part of the larger AIDIF-toolbox project and is licensed 
%       under the MIT license. A copy of the MIT License can be found in 
%       the project's root directory.
%
%   Copyright (c) 2025, AIDIF
%   All rights reserved

%[text] 
%create test basal data with a significant gap
gap = hours(6);
timestamps = datetime("today")+hours([0,1,2,4,12,14,16,23]) %[output:595b4cb7]
basal_rates = ones(length(timestamps),1)';basal_rates(2:2:end)=0; 
tt = timetable(timestamps', basal_rates', 'VariableNames', {'basal_rate'});

clf; hold on; %[output:340ff078]
[xs, ys] = stairs(tt.Properties.RowTimes, tt.basal_rate);
area(xs ,ys ,'FaceAlpha', 0.3, 'EdgeColor', 'none','FaceColor','blue',DisplayName='Basal Rate'); %[output:340ff078]
%scatter(tt.Properties.RowTimes, tt.basal_rate,"^","MarkerFaceColor","blue",MarkerEdgeColor="none",DisplayName='Basal Rate Change')
ylim([0, max(tt.basal_rate) + 0.1]) %[output:340ff078]
legend() %[output:340ff078]
%%
%[text] Resample basal data
ttResampled = AIDIF.interpolateBasal(tt);

yyaxis('right') %[output:063f8dc7]
stem(ttResampled,"Time","InsulinDelivery",Color='yellow',Marker='.',MarkerSize=10,DisplayName='deliveries') %[output:063f8dc7]
ylabel('U'); %[output:063f8dc7]
%%
%[text] Calculate valid flags for a gap threshold of 2 hours
ttResampled.valid = AIDIF.findGaps(tt.Time,ttResampled.Time,2);
% Highlight Nans
valid = ttResampled.valid; % Create a shorthand for the logical array
scatter(ttResampled.Time(valid ), ttResampled.InsulinDelivery(valid), 5,'o','MarkerEdgeColor','green',DisplayName='valid') %[output:1d217641]
scatter(ttResampled.Time(~valid ), ttResampled.InsulinDelivery(~valid), 5,'x','MarkerEdgeColor','red',DisplayName='invalid') %[output:1d217641]
ylim([0,5/60+0.1]) %[output:1d217641]
xlim([min(tt.Time) - minutes(10), max(tt.Time) + minutes(10)]); %[output:1d217641]
hold off %[output:1d217641]


